import React from 'react';
import Navbar from './Navbar';
import { NavLink } from 'react-router-dom';

const Homefront = () => {

    return (
        <> 
            <div className='hero'>
                <div className='hero-col'>
                    <h1>Matching Style and Class<br />with Luxury and Comfort.</h1>
                    <p>You were born to be a Trend. You were meant to be here.<br /> This moment is yours.</p>
                    <NavLink exact to='/productDetails' activeClassName='active_class'> <a className='more_btn'>Go Shopping</a></NavLink>
                </div>
                <div className='hero-col'>
                    <img src={require('../images/back.png')} alt='homebackground' />
                </div>
            </div>
        </>
    )

}

export default Homefront;
